/* jshint esversion: 6 */

const Core = require("leanft.sdk.core");
const Logger = Core.Logger;
const ObjectUtils = Core.ObjectUtils;
const ConcreteFactoryBehavior = Core.ConcreteFactoryBehavior;
const AiObjectTO = require("./ai_object.js").AiObjectTO;

function AIFactory(session){
    this._logger = new Logger("AI.TestObjectFactory");
    this._session = session;
    this._technology = "AI";

    ObjectUtils.extend(this, ConcreteFactoryBehavior);
}

AIFactory.prototype = {
    _logger: null,
    _session: null,
    _technology: null,

    _constructors: {
        "uiobject": AiObjectTO
    },

    _nativeClassToLeanFtType: {
        "aiobject": "uiobject",
    }
};
module.exports.AIFactory = AIFactory;